import React from 'react';
import '../../App.css';

'use strict';

const shell = document.getElementById('shell');

class Example extends React.Component {
  render() {
    return (
      <p>
        Hello<br/>
        World
      </p>
    );
  }
}

React.render(<Example/>, shell);


export default function Home() {
  return (
    <>

      <div className='home'>
      <h4>CHOCO PAP</h4> <br/>
      <p>Voir la boutique en ligne</p>
      </div>


    </>
  );
}
